INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 1, "調子が上がって\nきたなっ", "訓練はまだ\nここからですわ", 2, "vo_minigame_1013_icon_1_002_001", 1000, "vo_minigame_1013_icon_2_002_001", 3000, 2);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 2, "ほらほら、\nまだいけるだろ？", "クスクス、悪くない\n流れですわね", 2, "vo_minigame_1013_icon_1_003_001", 5000, "vo_minigame_1013_icon_2_003_001", 3000, 2);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 3, "へへっ、おまえら\nやるじゃねえか！", "すばらしい\n記録ですわ", 2, "vo_minigame_1013_icon_1_004_001", 10000, "vo_minigame_1013_icon_2_004_001", 3000, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 4, "あたしたちはまだ\n止まらねえぜ！", "乗りに乗って\nいますわね", 3, "vo_minigame_1013_icon_1_005_001", 10000, "vo_minigame_1013_icon_2_005_001", 3000, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 5, "見てろよ！\nマコト班の快進撃だ！", "まだまだ行きます\nついてきなさい", 3, "vo_minigame_1013_icon_1_005_002", 10000, "vo_minigame_1013_icon_2_005_002", 3000, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 6, "うおぉぉっ！\n絶好調だぜ！", "エリコ班の\n本領発揮ですわ！", 3, "vo_minigame_1013_icon_1_005_003", 10000, "vo_minigame_1013_icon_2_005_003", 3000, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (2, 7, "どこまで行けるか\n楽しみだなっ！", "ここからは\n前人未到の領域です！", 4, "vo_minigame_1013_icon_1_006_001", 0, "vo_minigame_1013_icon_2_006_001", 3000, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 8, "まだ諦めんなよっ", "厄介でしたわ…", 5, "vo_minigame_1013_icon_1_007_001", 1, "vo_minigame_1013_icon_2_007_001", 1000, 4);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 9, "冷やっとしたぜ…！", "油断大敵です", 5, "vo_minigame_1013_icon_1_007_002", 1, "vo_minigame_1013_icon_2_007_002", 1000, 4);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (3, 10, "弱音を吐くなっ", "忌々しいっ…", 5, "vo_minigame_1013_icon_1_007_003", 1, "vo_minigame_1013_icon_2_007_003", 1000, 4);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (4, 11, "マコト班集合！", "大所帯ですわね", 6, "vo_minigame_1013_icon_1_008_001", 99, "vo_minigame_1013_icon_2_008_001", 1500, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (4, 12, "連携してくぞ！", "エリコ班へようこそ", 6, "vo_minigame_1013_icon_1_008_002", 99, "vo_minigame_1013_icon_2_008_002", 1500, 3);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (1, 13, "みんなに力を！", "ナナカちゃんに\nお任せあれ", 8, "vo_minigame_1013_icon_1_020_001", 0, "vo_minigame_1013_icon_2_020_001", 3000, 6);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (1, 14, "任せてくれたまえ", "はっはっは！\n任せろ！", 9, "vo_minigame_1013_icon_1_022_001", 0, "vo_minigame_1013_icon_2_022_001", 3000, 7);
INSERT INTO `v1_8b031f954db81fe8c0737986f32cdc795df10c17f52e6d7b9c096df8aba6858c` VALUES (1, 15, "ほな、いきまひょか", "どんどんいくわよ", 10, "vo_minigame_1013_icon_1_023_001", 0, "vo_minigame_1013_icon_2_023_001", 3000, 8);
